import React, { useEffect, useState } from 'react';
import './slideShow.css';

export default function SlideShow() {


    return (
        <div>



            {/* You can add more ".slideshow-image" elements, but remember to update the "$items" variable on SCSS */}
            <div className="slideshow">
                <img src="https://images.pexels.com/photos/1329711/pexels-photo-1329711.jpeg?auto=compress&cs=tinysrgb&w=600" className="slide"/>
                    <img src="https://images.pexels.com/photos/2086987/pexels-photo-2086987.jpeg?auto=compress&cs=tinysrgb&w=600" className="slide"/>
                        <img src="https://images.pexels.com/photos/14495885/pexels-photo-14495885.jpeg?auto=compress&cs=tinysrgb&w=600" className="slide"/>
            </div>

        </div>

    );
}
